// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.24;

import "../utils/ElectionTypes.sol";

abstract contract ElectionLogic {
    using ElectionTypes for ElectionTypes.Election;
    using ElectionTypes for ElectionTypes.Round;

    struct ElectionStorage {
        uint256 electionsCount;
        mapping(uint256 => ElectionTypes.Election) elections;
        mapping(uint256 => mapping(uint8 => ElectionTypes.Round)) electionRounds;
        mapping(uint256 => mapping(uint8 => mapping(uint256 => uint256))) roundCandidateVotes;
        mapping(uint256 => mapping(uint8 => address[])) votersByRound;
    }

    event ElectionCreated(
        uint256 indexed electionId,
        uint256 electionStartDate,
        uint256 firstRoundStartDate,
        uint256 roundDuration,
        uint256[] candidateIds
    );

    event RoundFinalized(
        uint256 indexed electionId,
        uint8 round,
        bool finished,
        uint256 winnerCandidateId
    );

    function getRoundResults(
        ElectionStorage storage self,
        uint256 _electionId,
        uint8 _round
    )
        internal
        view
        returns (
            uint256 totalVotes,
            uint256[] memory candidateIds,
            uint256[] memory votesPerCandidate,
            uint256 startDate,
            uint256 endDate
        )
    {
        ElectionTypes.Round storage round = self.electionRounds[_electionId][
            _round
        ];
        totalVotes = round.totalVotes;
        startDate = round.startDate;
        endDate = round.endDate;

        candidateIds = self.elections[_electionId].candidateIds;
        votesPerCandidate = new uint256[](candidateIds.length);
        for (uint256 i = 0; i < candidateIds.length; i++) {
            votesPerCandidate[i] = self.roundCandidateVotes[_electionId][
                _round
            ][candidateIds[i]];
        }
    }
}

